import React, { Component } from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import web3 from './web3';
// import Accounts from './accounts';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import BuildParts from './components/build_items/parts/BuildParts';
import BuildProducts from './components/build_items/products/BuildProducts';


class App extends Component() {
  /* state = { accounts: [] };

  async componentDidMount() {
    const accounts = await web3.eth.getAccounts();
    console.log(accounts);
  } */
  render() {
    return (
      <div className="container">
        <p>Your current account address is : {this.state.accounts}</p>
        <Router>
          <Switch>
            <Route exact path='/' component={BuildParts} />
            <Route export path='/products' component={BuildProducts} />
          </Switch>
        </Router>
      </div>
    );
  }
}

export default App;
